import Users from '../models/users.model'
import { createAccessToken } from '../libs/jwt'
import jwt from 'jsonwebtoken'
import { appConfig } from '../config.js'

export const iniciarSesion = async (req, res) => {
  try {
    const { codigo, password, rol } = req.body // Destructurando el req.body solo para obtener el codigo y password necesarios
    const userFound = await Users.findOne({ codigo }).populate('rol') // Consulta de un usuario por cdigo, que a su vez obtiene el id del rol que tiene asociado
    if (!userFound) return res.status(404).json({ message: 'Lo siento, pero el cdigo de usuario ingresado no corresponde a ninguna cuenta existente. Por favor, verifica el cdigo de usuario e intenta de nuevo.' })
    const matchPassword = await Users.comparePassword(password, userFound.password) // Llamado a la funcin comparePassword en modelo "Users" que compara las contraseas: La ingresada y la guardada en base de datos
    if (!matchPassword) return res.status(400).json({ message: 'Contrasea invlida. Por favor, verifica e intenta de nuevo.' })
    const token = await createAccessToken(userFound._id) // Creacin del token si las contraseas coincidieron
    if (rol !== userFound.rol.nombre) return res.status(404).json({ message: 'Lo siento, pero el tipo de usuario seleccionado no corresponde a tu cuenta. Por favor, selecciona el rol correcto e intenta de nuevo.' })
    res.cookie('token', token)
    res.json({
      codigo: userFound.codigo,
      nombre: userFound.nombre,
      correo: userFound.correo,
      rol: userFound.rol._id
    })
  } catch (error) {
    res.status(500).json({ message: error.message })
  }
}

export const cerrarSesion = (req, res) => {
  console.log('cerrandoSesion')
  res.cookie('token', '', { expires: new Date(0) })
  return res.sendStatus(200)
}

export const verify = async (req, res) => {
  const { token } = req.cookies

  if (!token) return res.status(401).json({ message: 'No autorizado.' })

  jwt.verify(token, appConfig.secret, async (err, user) => {
    if (err) return res.status(401).json({ message: 'No autorizado.' })

    const userFound = await Users.findById(user.id)
    if (!userFound) return res.status(401).json({ message: 'No autorizado.' })

    return res.json({
      codigo: userFound.codigo,
      nombre: userFound.nombre,
      correo: userFound.correo,
      rol: userFound.rol._id
    })
  })
}

