import jwt from 'jsonwebtoken';
import { appConfig } from '../config.js'
import Users from '../models/users.model.js';

export const verifyToken = async (req, res, next) => {
    const token = await req.headers['token-acceso']
    console.log(token)
    if(!token) return res.status(401).json({ mensaje: 'No se proporcion un token de acceso. Por favor, verifica e intenta de nuevo.' });
    const userToken = jwt.verify(token, appConfig.secret)
    const user = await Users.findById(userToken.id, {password: 0})
    console.log(user)
    if (!user) return res.status(404).json({mensaje: 'Usuario no encontrado.'})
    next()
}

