import Users from '../models/users.model'
import Roles from '../models/roles.model.js'

export const createUser = async (req, res) => {
  const { codigo, nombre, correo, password, rol } = req.body // Obteniendo todos las credenciales de usuario de req.body
  const newUser = new Users({ codigo, nombre, correo, password: await Users.encryptPassword(password), rol }) // Creando el usuario y encriptando su comtrasea por medio de la funcin encryptContrasea declarada en el modelo "Users"
  try {
    const foundCodigo = await Users.findOne({ codigo: req.body.codigo }) // Consulta para verificar que el cdigo no exista
    if (foundCodigo) {
      res.status(409).json({ message: 'El cdigo ya est en uso. Por favor, elige otro.' }) // Si existe message que indica que el cdigo est en uso
    } else {
      if (rol) {
        const foundRol = await Roles.findOne({ nombre: rol }) // Consulta para encontra el rol que fue pasado como req.body.rol
        if (foundRol && foundRol.nombre !== 'Escuela') { // Si el rol existe y adems es diferente al rol de escuela, se podrn crear usuarios de tipo estudiante y de tipo docente
          newUser.rol = foundRol._id // Si el rol existe se asigna el id al campo rol de la coleccin o modelo "Users"
        } else {
          return res.status(400).json({ message: 'El rol especificado no corresponde a uno de estos roles: [Estudiante, Profesor]. Por favor, verifica e intenta de nuevo.' }) // De lo contrario message que indica que no existe el rol
        }
      } else {
        const role = await Roles.findOne({ nombre: 'Estudiante' }) // Si no se define un req.body.rol entonces se asigna automticamente el rol de estudiante
        newUser.rol = role._id
      }
      const savedUser = await newUser.save() // Guardando el usuario en base de datos
      res.json({ codigo: savedUser.codigo, nombre: savedUser.nombre, correo: savedUser.correo, rol })
    }
  } catch (error) {
    res.status(500).json({ message: error.message })
  }
}

