import Roles from '../models/roles.model.js'

export const checkRolExisted = async (req, res, next) => {
    const {rol} = req.body
    if (rol) {
        const rolSave = await Roles.findOne({ nombre: rol })
        if(!rolSave) {
            return res.status(400).json({mensaje: `El rol ${rol} no existe`})
        }
        else {
            next()
        }
    }
}

