sourcesContent:
import Roles from '../models/roles.model.js'
import Users from '../models/users.model.js'

export const checkDuplicateCodeOrEmail = async (req, res, next) => {
    const {codigo, correo} = req.body
    const code = await Users.findOne({ codigo })
    if (code) { return res.status(400).json({mensaje: 'Ya existe un usuario con este cdigo.'})}
    const email = await Users.findOne({ correo })
    if (email) { return res.status(400).json({mensaje: 'Ya existe un usuario con este correo electrnico.'})}
    else {next()}
}

export const checkRolExisted = async (req, res, next) => {
    const {rol} = req.body
    if (rol) {
        const rolSave = await Roles.findOne({ nombre: rol })
        if(!rolSave) {
            return res.status(400).json({mensaje: `El rol ${rol} no existe`})
        }
        else {
            next()
        }
    }
}

