import { z } from 'zod'

export const registerSchema = z.object({
  codigo: z.string({
    required_error: 'El cdigo es requerido.'
  }).length(7, { message: 'La longitud del cdigo es de 7 caracteres.' })
    .refine(codigo => !isNaN(Number(codigo)), { message: 'El cdigo debe ser nmerico.' }),
  nombre: z.string({
    required_error: 'El nombre de usuario es necesario para el registro.'
  }).min(1, { message: 'El nombre debe contener mnimo 1 caracter.' }).max(50, { message: 'El nombre debe contener mximo 50 caracteres.' }),
  correo: z.string({
    required_error: 'El correo electrnico es requerido.'
  }).email({
    message: 'Correo electrnico invlido.'
  }),
  password: z.string({
    required_error: 'La contrasea es requerida.'
  }).min(14, { message: 'La contrasea debe contener mnimo 14 caracteres.' }).max(32, { message: 'La contrasea debe contener mximo 32 caracteres.' }),
  rol: z.enum(['Estudiante', 'Profesor'])
})
